solution:
The common ratio between consecutive terms is $\frac{3}{5}$ (you can choose any two consecutive terms and divide the second one by the first to find the common ratio). So the $n^\text{th}$ term of the sequence is $\frac{125}{9} \cdot \left( \frac{3}{5} \right)^{n-1}$. Plugging in $n=8$, we get $$
\frac{125}{9} \cdot \left( \frac{3}{5} \right)^{7} = \frac{5^3}{3^2} \cdot \frac{3^7}{5^7}
= \frac{3^5}{5^4}
= \boxed{\frac{243}{625}}.
$$

Let's write the first sentence as an equation: \begin{align*}
\frac{x}{y} &= \frac{1}{2}, \\
2x &= y.
\end{align*}

Now, we can substitute this into the given equation to find $x$: \begin{align*}
2x &= 4x - 36, \\
36 &= 2x, \\
\boxed{18} &= x.
\end{align*}

Multiply both numerator and denominator by $\sqrt7$:

\begin{align*}
\frac1{2\sqrt7} &= \frac1{2\sqrt7}\cdot\frac{\sqrt7}{\sqrt7}\\
&= \boxed{\frac{\sqrt7}{14}}.
\end{align*}

