\begin{align*}
\cos \theta &= \frac{(\mathbf{u} + \mathbf{v}) \cdot (2 \mathbf{u} - \mathbf{v})}{\|\mathbf{u} + \mathbf{v}\| \|2 \mathbf{u} - \mathbf{v}\|} \\
&= \frac{(\mathbf{u} + \mathbf{v}) \cdot (2 \mathbf{u} - \mathbf{v})}{\|\mathbf{u} + \mathbf{v}\| \|2 \mathbf{u} - \mathbf{v}\|}.
\end{align*}We can read the lengths of the vectors $\mathbf{u} + \mathbf{v}$ and $2 \mathbf{u} - \mathbf{v}$ from the Triangle Law.

[asy]
unitsize(1 cm);

pair A, B, C, D, E, F;

A = (sqrt(15)/2,0);
B = (A + 2*dir(180 - acos(1/4)));
C = (2*A + B)/3;
D = A + C;
E = interp(B,D,(sqrt(15)/2 - 1)/sqrt(15));
F = interp(B,C,(sqrt(15)/2 - 1)/sqrt(15));

draw((0,0)--A,Arrow(6));
draw((0,0)--B,Arrow(6));
draw(A--(0,0));
draw(A--B);
