Note that the sides in the big triangle are in proportion 1:2:2, so the sides in the small triangle are also in proportion 1:2:2.  This gives us
\[\frac{\|\mathbf{u} + \mathbf{v}\|}{\|2 \mathbf{u} - \mathbf{v}\|} = \frac{1}{2}.\]Then
\[\cos \theta = \frac{(\mathbf{u} + \mathbf{v}) \cdot (2 \mathbf{u} - \mathbf{v})}{\frac{1}{2} \|\mathbf{u} + \mathbf{v}\| \|2 \mathbf{u} - \mathbf{v}\|} = 2(\mathbf{u} + \mathbf{v}) \cdot (2 \mathbf{u} - \mathbf{v}).\]Now,
\begin{align*}
2(\mathbf{u} + \mathbf{v}) \cdot (2 \mathbf{u} - \mathbf{v}) &= 2 (\mathbf{u} \cdot 2 \mathbf{u} - 2 \mathbf{u} \cdot \mathbf{v} + \mathbf{v} \cdot 2 \mathbf{u} - \mathbf{v} \cdot \mathbf{v}) \\
&= 4 (\mathbf{u} \cdot \mathbf{u}) - 4 (\mathbf{u} \cdot \mathbf{v}) + 2 (\mathbf{v} \cdot \mathbf{v}) \\
&= 4 \cdot 2^2 - 4 (-1) + 2 \cdot 2^2 \\
&= \boxed{24}.
\end{align*}

