solution:
We know that
\[\text{proj}_{\bold{w}} \bold{v} = \frac{\bold{v} \cdot \bold{w}}{\bold{w} \cdot \bold{w}} \bold{w} = \begin{pmatrix} 2 \\ -11 \end{pmatrix}.\]Then
\begin{align*}
\text{proj}_{-\bold{w}} (\bold{v}) &= \frac{(\bold{v}) \cdot (-\bold{w})}{(-\bold{w}) \cdot (-\bold{w})} (-\bold{w}) \\
&= \frac{-\bold{v} \cdot \bold{w}}{\bold{w} \cdot \bold{w}} (-\bold{w}) \\
&= \frac{\bold{v} \cdot \bold{w}}{\bold{w} \cdot \bold{w}} \bold{w} \\
&= \boxed{\begin{pmatrix} 2 \\ -11 \end{pmatrix}}.
\end{align*}Geometrically speaking, multiplying the vector onto which we are projecting by a nonzero scalar doesn't affect the projection at all.  In a projection, we only care about the direction of the vector onto which we are projecting; we don't care about that vector's magnitude.  That is, we have
\[\text{proj}_{k\bold{w}} \bold {v} = \text{proj}_{\bold{w}}\bold{v}\]for all nonzero $k$, $\bold{w}$.

