Since $\triangle ABC$ is an isosceles right triangle, we know that $\angle ABC = 90^\circ$. Thus, we know that $\angle BAC = \angle BCA = 45^\circ$. Call the foot of the altitude from $A$ to $\overline{BC}$ as point $E$. We now have that $\triangle AEB \sim \triangle AEC$. By $AA$ similarity, we have that $\angle BAE = 45^\circ$. Thus, we conclude that $\triangle AEB$ is an isosceles right triangle. 

We apply the same steps to $\triangle AEC$ and have that point $E$ is the midpoint of $\overline{BC}$ as well. Since $BC=2$, we have that $BE=EC=1$. 

We now have that $AB=AE+EB=\sqrt{2}+1$. Similarly, we deduce that $AC=\sqrt{2}+1$. 

Now, we can move on to solving for $AD$. Since $\triangle ABD\sim\triangle ABC$, we have that $AD = \frac{AB}{\sqrt{2}}$. Furthermore, we have that $AB = 1+\sqrt{2}$, so substituting, we see that $AD = \frac{1+\sqrt{2}}{\sqrt{2}} = \frac{1}{\sqrt{2}}+\sqrt{2}$.

