gpt-4_answer:
First, $|x + y - 1| = x + y - 1$ if $x + y \ge 1,$ and $|x + y - 1| = 1 - x - y$ if $x + y \le 1.$

Now,
\[\Big| |x| - x \Big| = \begin{cases} x & \text{if $x \ge 0$}, \\ -x & \text{if $x \le 0$}. \end{cases}\]Also,
\[\Big| |x - 1| + x - 1 \Big| = \begin{cases} 1 - x & \text{if $x \le 1$}, \\ x - 1 & \text{if $x \ge 1$}. \end{cases}\]Our equation $|x + y - 1| + \Big| |x| - x \Big| + \Big| |x - 1| + x - 1 \Big| = 0$ breaks up into the following cases.

1. $x \le 0,$ $x + y \le 1,$ and $x \le 1.$  Then
\[-x + (1 - x - y) + (1 - x) = 0,\]so $y = 2.$

2. $x \le 0,$ $x + y \le 1,$ and $1 \le x.$  This case is impossible.

3. $x \le 0,$ $1 \le x + y,$ and $x \le 1.$  Then
\[-x + (x + y - 1) + (1 - x) = 0,\]which reduces to $y = 2.$

4. $x \le 0,$ $1 \le x + y,$ and $1 \le x.$  This case is impossible.

5. $0 \le x,$ $x + y \le 1,$ and $x \le 1.$  Then
\[(x + y - 1) + x + (1 - x) = 0,\]which simplifies to $y = -x.$

6. $0 \le x,$ $x + y \le 1,$ and $1 \le x.$  This case is impossible.

7. $0 \le x,$ $1 \le x + y,$ and $x \le 1.$  Then
\[(x + y - 1) + x + (x - 1) = 0,\]which simplifies to $y = 1.$

8. $0 \le x,$ $1 \le x + y,$ and $1 \le x.$  This case is impossible.

Thus, the coordinates of the vertices are $A = (0,2),$ $B = (-1,2),$ $C = (1,1),$ and $D = (0,0).$  The  curve is then a quadrilateral.

