\[\frac{1}{2} y \cdot CD = 9.\]The area of rectangle $ABCD$ is $BC \cdot CD$, so the area of $\triangle ABE + \triangle ADF + \triangle CEF$ is
\[\frac{1}{2} x \cdot BC + \frac{1}{2} y \cdot CD = BC \cdot CD - 5.\]Hence,
\[BC \cdot CD = 8 + 5 + 9 = 22,\]so the area of rectangle $ABCD$ is $\boxed{22}$.

