[/asy]

solution:
We plug in $x = 4$: \begin{align*}
3(4) + 2y &= 12\\
12 + 2y &= 12\\
y &= 0.
\end{align*}

Therefore, $b = \boxed{0}$.

The area of triangle $ABC$ is given by
\[[ABC] = \frac{1}{2} AC \cdot BC \cdot \sin C.\][asy]
unitsize (1 cm);

pair A, B, C, D;

A = (0,0);
B = (5,0);
C = (1,2);
D = extension(C, incenter(A,B,C), A, B);

draw(A--B--C--cycle);
draw(C--D);

label("$A$", A, SW);
label("$B$", B, SE);
label("$C$", C, N);
label("$D$", D, S);
label("$6$", (C + D)/2, NE);
[/asy]

We can also write
\begin{align*}
[ABC] &= [ACD] + [BCD] \\
&= \frac{1}{2} AC \cdot CD \sin \frac{C}{2} + \frac{1}{2} BC \cdot CD \sin \frac{C}{2} \\
&= 3AC \sin \frac{C}{2} + 3BC \sin \frac{C}{2} \\
&= 3 (AC + BC) \sin \frac{C}{2}.
\end{align*}Thus,
\[\frac{1}{2} AC \cdot BC \cdot \sin C = 3(AC + BC) \sin \frac{C}{2}.\]Then
\[AC \cdot BC \sin \frac{C}{2} \cos \frac{C}{2} = 3(AC + BC) \sin \frac{C}{2},\]so
\[\frac{AC \cdot BC}{3} = 3 (AC + BC).\]Hence,
\[\frac{1}{AC} + \frac{1}{BC} = \frac{AC + BC}{AC \cdot BC} = \boxed{\frac{1}{9}}.\]

problem:
In the diagram, points $X$, $Y$ and $Z$ are on the sides of $\triangle UVW$, as shown.  Line segments $UY$, $VZ$ and $WX$ intersect at $P$.  Point $Y$ is on $VW$ such that $VY:YW=4:3$. If $\triangle PYW$ has an area of 30 and $\triangle PZW$ has an area of 35, determine the area of $\triangle UXP$. [asy]
size(6cm);
pair v = (0, 0); pair w = (10, 0); pair u = (3.5, 7);
pair y = 4 * w / 7;
pair x = 56 * u / 140;
pair p = IP(w--x, u--y);
pair z = IP(v--(10 * p), u--w);
draw(u--v--w--cycle);
draw(u--y);draw(x--w);draw(z--v);

label("$U$", u, N);
label("$X$", x, NW);
label("$P$", p, NE + 0.2 * W);
label("$Z$", z, NE);
label("$V$", v, SW);
label("$Y$", y, S);
label("$W$", w, SE);/*
label("$a$", centroid(p, v, y), fontsize(10));
label("$b$", centroid(p, z, u), fontsize(10));
label("$c$", centroid(p, u, x), fontsize(10));
label("$d$", centroid(p, x, v), fontsize(10));
label("$30$", centroid(p, y, w) + 0.2 * W, fontsize(10));
label("$35$", centroid(p, z, w), fontsize(10));*/
[/asy]

solution:
Recall that if two triangles have their bases along the same straight line and they share a common vertex that is not on this line, then the ratio of their areas is equal to the ratio of the lengths of their bases. We will use this fact extensively throughout the proof.

Let the area of $\triangle PYV$, $\triangle PZU$, $\triangle UXP$, and $\triangle XVP$, be $a$, $b$, $c$, and $d$, respectively. [asy]
size(6cm);
pair v = (0, 0); pair w = (10, 0); pair u = (3.5, 7);
pair y = 4 * w / 7;
pair x = 56 * u / 140;
pair p = IP(w--x, u--y);
pair z = IP(v--(10 * p), u--w);
draw(u--v--w--cycle);
draw(u--y);draw(x--w);draw(z--v);

label("$U$", u, N);
label("$X$", x, NW);
label("$P$", p, NE + 0.2 * W);
label("$Z$", z, NE);
label("$V$", v, SW);
label("$Y$", y, S);
label("$W$", w, SE);
label("$a$", centroid(p, v, y), fontsize(10));
label("$b$", centroid(p, z, u), fontsize(10));
label("$c$", centroid(p, u, x), fontsize(10));
label("$d$", centroid(p, x, v), fontsize(10));
label("$30$", centroid(p, y, w) + 0.2 * W, fontsize(10));
label("$35$", centroid(p, z, w), fontsize(10));
[/asy] Since $$\frac{|\triangle PYV|}{|\triangle PYW|}=\frac{VY}{YW}=\frac{4}{3},$$then $$a = |\triangle PYV|=\frac{4}{3}\times |\triangle PYW|=\frac{4}{3}(30)=40.$$Also, $\frac{|\triangle VZW|}{|\triangle VZU|}=\frac{ZW}{ZU}=\frac{|\triangle PZW|}{|\triangle PZU|}$ or $|\triangle VZW|\times |\triangle PZU| = |\triangle PZW| \times |\triangle VZU|$. Thus, $$\frac{|\triangle VZU|}{|\triangle PZU|}=\frac{|\triangle VZW|}{|\triangle PZW|}=\frac{35+30+40}{35}=\frac{105}{35}=\frac{3}{1}.$$Therefore,  $\frac{|\triangle VZU|}{|\triangle PZU|}=\frac{3}{1}$, or $\frac{b+c+d}{b}=\frac{3}{1}$ or $b+c+d=3b$ and $c+d=2b$.

Next, $$\frac{|\triangle UVY|}{|\triangle UYW|}=\frac{VY}{YW}=\frac{4}{3},$$so $$\frac{40+c+d}{30+35+b}=\frac{4}{3}.$$Since $c+d=2b$, we have $3(40+2b)=4(65+b)$, so $120+6b=260+4b$, then $2b=140$ and $b=70$.

Next, $$\frac{|\triangle UXW|}{|\triangle XVW|}=\frac{UX}{XV}=\frac{|\triangle UXP|}{|\triangle XVP|},$$or $$\frac{35+b+c}{30+a+d}=\frac{c}{d}.$$Since $b=70$ and $a=40$, $\frac{105+c}{70+d}=\frac{c}{d}$, or $d(105+c)=c(70+d)$. Thus, $105d+cd=70c+cd$ or $105d=70c$, and $\frac{d}{c}=\frac{70}{105}=\frac{2}{3}$ or $d=\frac{2}{3}c$.

Since $c+d=2b=2(70)=140$, we have $$c+d=c+\frac{2}{3}c=\frac{5}{3}c=140,$$or $c=\frac{3}{5}(140)=84$. Therefore, the area of $\triangle UXP$ is $\boxed{84}$.

problem:
If $a,b,c$ are positive integers less than $13$ such that \begin{align*}
2ab+bc+ca&\equiv 0\pmod{13}\\
ab+2bc+ca&\equiv 6abc\pmod{13}\\
ab+bc+2ca&\equiv 8abc\pmod {13}
\end{align*}then determine the remainder when $a+b+c$ is divided by $13$.

gpt-4_answer:
We first note that addition of the first two congruences yields \begin{align*}
ab+3bc+3ca&\equiv 6abc \pmod {13}\\
(1+2a)bc+(2+a)ca&\equiv 6abc \pmod {13}
\end{align*}Thus either $|ab-c(a+2)|$ or $|bc-3(a+2)c|$ is divisible by $13.$ But since $a<13, b<13, c<13,$ we have $|ab|^2  |a^2-9b^2|\implies a=b=\frac{13\pm 4}{2}=9,4.$ However since $ab\equiv 0 \pmod {13}$ and $a=b,$ we only have $a=b=9.$ Thus $ab(1+2b)\equiv 0 \pmod {13}\implies c\equiv 0 \pmod {13},$ contradiction. Thus we must have $|bc-3(a+2)c|=13\implies bc+26\equiv 13\pmod {13^2}\implies bc\equiv -13 \pmod {13^2}.$

Now we do something similar for the second and third congruences: \begin{align*}
2ab+3bc+3ca&\equiv 14abc \pmod {13}\\
abc+(a+2)(b+2)c&\equiv 6ab+8ac \pmod {13}
\end{align*}Thus either $|ab-c(a+b+4)|$ or $|bc-3(13-b)(13-c)|$ is divisible by $169.$ But since $a<13, b<13, c<13,$ we have $|ab|^2  |a^2-9b^2|\implies a=b=\frac{13\pm 4}{2}=9,4.$ However since $ab\equiv 0 \pmod {13}$ and $a=b,$ we only have $a=b=9.$ Thus $ab(1+2b)\equiv 0 \pmod {13}\implies c\equiv 0 \pmod {13},$ contradiction. Thus we must have $|bc-3(13-b)(13-c)|=169\implies bc+(65-c)(13-c)\equiv 13\pmod {13^2}\implies bc\equiv 13 \pmod {13^2}.$

Now note that \[b+c=13\equiv -bc\pmod {13}\implies b+c=-bc\pmod {169},\] so $b+c=-169\pmod {169}=0 \pmod {169}\implies b+c\equiv 13 \pmod {13^2}.$ But by CRT, there is only one solution mod $169-$ hence $a+b+c\equiv 3 \cdot 13 \pmod {13\cdot 13^2}\implies a+b+c\equiv \boxed{39} \pmod {13^3}.$

problem:
The dartboard below has a radius of 6 inches. Each of the concentric circles has a radius two inches less than the next larger circle. If nine darts land randomly on the target, how many darts would we expect to land in a non-shaded region?

[asy]import graph;
fill(Circle((0,0),15),gray(0.7));
fill(Circle((0,0),10),white);
draw(Circle((0,0),20));
draw(Circle((0,0),15));
draw(Circle((0,0),10));
[/asy]

On the number line, point $A$ is located at 0, point $B$ is located at 4, and point $C$ is located at 6. [asy]
defaultpen(1);
draw((0,0)--(6,0));
for (int i=0;i<7;++i){

draw((i,-.1)--(i,.1));

label(string(i),(i,-.1),(0,-1));
}
label("\(A\)",(0,0),(0,1));
label("\(B\)",(4,0),(0,1));
label("\(C\)",(6,0),(0,1));
[/asy] A dart randomly lands somewhere on the number line between $A$ and $C$.  What is the probability that it lands closer to $B$ than it does to $A$ or $C$?

solution:
First, suppose that the dart lands between $A$ and $B$.  It then has a probability of 1/2 of being closer to $A$ than to $B$, and it is always closer to $B$ than it is to $C$, so it is closer to $B$ than it is to $A$ and $C$ with probability 1/2.

On the other hand, if it lands between $B$ and $C$, then it is definitely closer to $B$ than to $A$, and it has a probability of 1/2 of being closer to $B$ than to $C$.  As before, it is closer to $B$ than it is to $A$ and $C$ with probability ${1/2}$.

[asy]
defaultpen(.7);

draw((0,0)--(6,0));
for(int i=0;i<=6;++i){

draw((i,-.1)--(i,.1));

label(string(i),(i,-.1),(0,-1));
}

label("\(A\)",(0,0),(0,1));
label("\(B\)",(4,0),(0,1));
label("\(C\)",(6,0),(0,1));

draw((2,0)--(5,0),linewidth(3.5));
[/asy] In either case, the probability that the dart lands closest to $B$ is 1/2, so the probability overall is $\boxed{\frac{1}{2}}$.

