Let $x = \angle CBA.$  Then $\angle BCA = 180^\circ - x - 90^\circ = 90^\circ - x,$ so $\angle BCD = 180^\circ - 2x.$

[asy]
unitsize(0.8 cm);

pair A, B, C, D;

A = (1,0);
B = (1,5*sqrt(24)/sqrt(25));
C = (0,0);
D = intersectionpoint(Circle(A,219/125),B--(B + 4*dir(180 - 3*acos(1/5))));
//D = (A + 2*C)/3;
draw(A--B--C--cycle);
draw(B--D);

label("$A$", A, E);
label("$B$", B, N);
label("$C$", C, SW);
label("$D$", D, SW);
[/asy]

From the given information,
\begin{align*}
\angle BDA + \angle ADC &= 180^\circ - \angle CBA = 180^\circ - x, \\
\angle ADC + x &= 180^\circ - 2x.
\end{align*}Subtracting these equations, we get $\angle BDA = 3x,$ so triangles $ABC$ and $BDC$ are similar.

By the Law of Cosines on triangle $ABC,$
\[(AC)^2 = (1)^2 = (AB)^2 + (BC)^2 - 2 \cdot AC \cdot BC \cdot \cos \angle CBA = 25 + (BC)^2 - 10 \cdot BC \cdot \cos x.\]By the Law of Cosines on triangle $BDC,$
\[(BC)^2 = (DB)^2 + (DC)^2 - 2 \cdot DB \cdot DC \cdot \cos \angle BCD = (DB)^2 + (DC)^2 + 4 \cdot \cos 2x.\]Then $25 - 10 \cdot BC \cdot \cos x = (DB)^2 + (DC)^2 + 4 \cdot \cos 2x.$

From the Angle Addition Formula,
\[\cos 2x = \cos (x + x) = \cos x \cos x - \sin x \sin x = \cos^2 x - \sin^2 x.\]Also,
\[\sin^2 x = 1 - \cos^2 x.\]Hence,
\[\cos (2x) = 2 \cos^2 x - 1.\]Then
\[25 - 10 \cdot BC \cdot \cos x = (DB)^2 + (DC)^2 + 8 \cos^2 x - 4.\]Thus, $(DB)^2 + (DC)^2 + 8 \cos^2 x = 21 - 10 \cdot BC \cdot \cos x.$

Dividing the sides by $(AB)^2 = 25,$ we get
\[\left( \frac{BD}{AB} \right)^2 + \left( \frac{DC}{AB} \right)^2 + 8 \left( \frac{\cos x}{25} \right)^2 = \frac{21}{25} - \frac{2 \cdot BC \cdot \cos x}{5}.\]Then
\[\left( \frac{1}{5} \right)^2 + \left( \frac{D}{25} \right)^2 + 8 \left( \frac{\cos x}{25} \right)^2 = \frac{21}{25} - \frac{BD \cdot AD}{25}.\]Hence,
\[\frac{1}{25} + \frac{D^2}{625} + 8A^2 = \frac{21}{25} - A \cdot D.\]Since $0 < \cos x < 1,$ $0 < A < 1,$ so $0 < D < 1.$  Furthermore, $A + D = 1,$ so $D = 1 - A.$

Then
\[\frac{1}{25} + \frac{(1 - A)^2}{625} + 8A^2 = \frac{21}{25} - A (1 - A).\]Filling the gap between the hand computation and technology, we obtain
\[A = \frac{219}{125}.\]Therefore, $D = \boxed{\frac{6}{125}}.$

