problem:
Triangle $ABC$ is isosceles, with $AB=AC$ and altitude $AM=11.$ Suppose that there is a point $D$ on $\overline{AM}$ with $AD=10$ and $\angle BDC=3\angle BAC.$  Find the perimeter of triangle $ABC.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

solution:
Let $E$ be the foot of the perpendicular from $B$ to $\overline{CD}$. Then $AB = DE$ and $BE =
AD = 7$. By the Pythagorean Theorem, \begin{align*}
AD^2 = BE^2 &= BC^2 - CE^2\\
&= (CD+AB)^2 - (CD - AB)^2\\
&=(CD+AB+CD-AB)(CD+AB-CD+AB)\\
&=4\cdot CD \cdot AB.
\end{align*}Hence, $AB \cdot CD = AD^2/4=7^2/4=49/4=\boxed{12.25}$.

[asy]
pair A,B,C,D,I;
A=(0,0);
B=(0,5);
C=(7,7);
I=(7,5);
D=(7,0);
draw(A--B--C--D--cycle);
draw(B--I);
label("$A$",A,W);
label("$B$",B,W);
label("$C$",C,E);
label("$E$",I,E);
label("$D$",D,E);
[/asy]

