solution:
Drawing the square in the complex plane, we see that 4 and $-2+4i$ are opposite vertices. The length of the diagonal is the magnitude of the difference of these numbers, $|4-(-2+4i)| = |6-4i| = \sqrt{6^2 + 4^2} = \boxed{2\sqrt{13}}$.

[asy]
unitsize(0.5 cm);

pair A, B, C, D;

A = (4,0);
B = (3,5);
C = (-2,4);
D = (-1,-1);

draw(A--B--C--D--cycle);

dot("$4$", A, SE);
dot("$3 + 5i$", B, NE);
dot("$-2 + 4i$", C, NW);
dot("$-1 - i$", D, SW);
[/asy]

Alternatively, we could note that 4 and $3+5i$ are adjacent vertices, so the square has side length $s = |4 - (3+5i)| = |1-5i| = \sqrt{1^2 + 5^2} = \sqrt{26}$. The diagonal then has length $s\sqrt{2} = \sqrt{26} \cdot \sqrt{2} = \boxed{2\sqrt{13}}$.

problem:
Two $4\times 4$ squares intersect at right angles, bisecting their intersecting sides, as shown. The circle's diameter is the segment between the two points of intersection. What is the area of the shaded region created by removing the circle from the squares? [asy]
/* AMC8 2004 #25 Problem */
path square=((0,0)--(4,0)--(4,4)--(0,4)--cycle);
filldraw(shift(-sqrt(8)/2.0)*rotate(45)*square, lightgrey, black);
filldraw(shift(sqrt(8)/2,0)*rotate(45)*square, lightgrey, black);
filldraw(circle((0,sqrt(8)), sqrt(8)/2), white, black);
[/asy]

solution:
From the given equation,
\[2r + 3r \sin \theta = 6.\]Then $2r = 6 - 3r \sin \theta = 6 - 3y,$ so
\[4r^2 = (6 - 3y)^2 = 9y^2 - 36y + 36.\]Hence, $4(x^2 + y^2) = 9y^2 - 36y + 36.$  Then $4x^2 = 5y^2 - 36y + 36,$ so
\[4x^2 - 5y^2 + 36y - 36 = 0.\]We can write this equation as
\[\frac{(y - \frac{18}{5})^2}{\frac{144}{25}} - \frac{x^2}{\frac{36}{5}} = 1.\]Thus, the graph is a hyperbola.  The answer is $\boxed{\text{(E)}}.$

[asy]
unitsize(0.2 cm);

pair moo (real t) {
  real r = 6/(2 + 3*Sin(t));
  return (r*Cos(t), r*Sin(t));
}

path foo = moo(-41.8);
real t;

for (t = -41.8; t <= 221.8; t = t + 0.1) {
  foo = foo--moo(t);
}

draw(foo,red);

foo = moo(221.9);

for (t = 221.9; t <= 318.1; t = t + 0.1) {
  foo = foo--moo(t);
}

draw(foo,red);

draw((-12,0)--(12,0));
draw((0,-12)--(0,12));

limits((-12,-12),(12,12),Crop);
[/asy]

