Let $A,$ $B,$ and $C$ be the points corresponding to $\mathbf{a},$ $\mathbf{b},$ and $\mathbf{c},$ respectively.  Then $\angle AOB = \arccos \frac{1}{5}$ and $\angle AOC = \arccos \frac{1}{6}.$  Let $D$ be the projection of $A$ onto plane $BOC.$  Then $OD = \overrightarrow{\mathbf{0}D},$ and $OA \cdot OD = DA^2 = AD \cdot AO.$

[asy]
