label("$B$", B, W);
label("$C$", C, N);
label("$D$", D, E);
label("60^\circ", C, 1.5 * dir(C)/3);[/asy]

We have that $AB = BC = AC = 1,$ so $\triangle ABC$ is equilateral.  By the Law of Cosines on triangle $AOC,$
\[AC^2 = OA^2 + OC^2 - 2 \cdot OA \cdot OC \cdot \cos 60^\circ = 2 + 2 \cdot \frac{1}{3},\]so $2 \cdot OA \cdot OC \cdot \frac{1}{2} = \frac{1}{3}.$  Then
\[OD \cdot OA = OD \cdot OC - CD \cdot OC = \frac{1}{3}.\]Hence,
\[\overrightarrow{\mathbf{0}D} = \frac{\frac{1}{3}}{\|\overrightarrow{BO}\| \|\overremaining{OC}\|} \overrightarrow{OC} \times (\overrightarrow{OA} \times \overrightarrow{OC}) = 3 \mathbf{c} \times (\mathbf{a} \times \mathbf{c}).\]We have that
\begin{align*}
\mathbf{a} \times \mathbf{c} &= (\mathbf{b} + \mathbf{c}) \times \mathbf{c} \\
&= \mathbf{b} \times \mathbf{c} + \mathbf{c} \times \mathbf{c} \\
&= -\mathbf{c} \times \mathbf{b},
\end{align*}so
\[\overrightarrow{\mathbf{0}D} = -3 \mathbf{c} \times (\mathbf{c} \times \mathbf{b}) = -3 \mathbf{b} + 9 \mathbf{c}.\]Thus, $(p,q) = \boxed{(-3,9)}.$

