Now, by the Law of Cosines on triangle $APB,$
\begin{align*}
PB^2 &= PA^2 + AB^2 - 2 \cdot PA \cdot AB \cos \beta \\
(2x)^2 &= x^2 + (x + x)^2 - 2x(2x) \cos \beta \\
3x^2 &= 4x^2 - 4x^2 \cos \beta.
\end{align*}Hence,
\[\cos \beta = \frac{1}{4}.\]Since $AP = PQ = QB,$ the triangle $APB$ is isosceles with $PA = PB,$ so $\angle PAB = \angle PBA.$  Then quadrilateral $APQB$ is cyclic, which means
\[\angle AQB = \angle APB = \angle PAB = \alpha.\]In turn, this means
\[\angle ACB = \angle ACQ + \angle BCQ = \angle AQP + \angle BQP = \alpha + \beta.\]Finally,
\[\frac{\angle APQ}{\angle ACB} = \frac{\beta}{\alpha + \beta} = \frac{\frac{1}{4}}{\frac{1}{4} + 1} = \boxed{\frac{1}{5}}.\]

