solution:
The focus of the parabola $y^2 = 4ax$ is $F = (a,0),$ and the directrix is $x = -a.$  Let $F',$ $P',$ $Q',$ and $R'$ be the projections of $F,$ $P,$ $Q,$ and $R$ onto the directrix, respectively.  Let $p = PP' = PF,$ $q = QQ' = QF,$ $a = P'F',$ and $B = Q'F'.$  Since $P,$ $F,$ and $Q$ are collinear,
\[\frac{p}{q} = \frac{a}{b}.\][asy]
unitsize(1 cm);

real y;
pair F, P, Q, R, S;
pair Fp, Pp, Qp, Rp;

F = (1,0);

path parab = ((-4)^2/4,-4);

for (y = -4; y <= 4; y = y + 0.01) {
  parab = parab--(y^2/4,y);
}

P = intersectionpoint(F--(F + 5*(1,2)),parab);
Q = intersectionpoint(F--(F - 5*(1,2)),parab);
R = reflect((0,0),(1,0))*(P);
S = extension(Q,R,(0,0),(1,0));
Fp = (-1,0);
Pp = (-1,P.y);
Qp = (-1,Q.y);
Rp = (-1,R.y);

draw(parab,red);
draw(P--Q);
draw(P--R);
draw(S--R);
draw((-2,0)--(4,0));
draw((0,-4)--(0,4));
draw((-1,-4)--(-1,4),dashed);
draw(P--Pp);
draw(Q--Qp);
draw(R--Rp);

label("$x = -a$", (-1,-4), dir(270));
label("$p$", (P + Pp)/2, N, red);
label("$p$", (P + F)/2, SE, red);
label("$q$", (Q + Qp)/2, dir(270), red);
label("$q$", (Q + F)/2, SE, red);
label("$a$", (Pp + Fp)/2, W, red);
label("$b$", (Qp + Fp)/2, W, red);
label("$p$", (Rp + R)/2, dir(270), red);

dot("$F$", F, SE);
dot("$P$", P, N);
dot("$Q$", Q, dir(270));
dot("$R$", R, dir(270));
dot("$F'$", S, NW);
dot("$P'$", Pp, W);
dot("$Q'$", Qp, W);
dot("$R'$", Rp, W);
[/asy]

Then
\[\frac{F'Q'}{F'R'} = \frac{b}{a} = \frac{q}{p} = \frac{QQ'}{RR'}.\]This means triangles $F'Q'Q$ and $F'R'R$ are similar, so line $QR$ intersects the $x$-axis at $F' = \boxed{(-a,0)}.$

gpt-4_answer:
Since the line passes through the focus, its equation is of the form
\[y = mx + a\]for some real number $m.$  Setting $y^2 = 4ax,$ we get
\[y = \sqrt{4ax}.\]Thus,
\[\sqrt{4ax} = mx + a\]and $mx + a - \sqrt{4ax} = 0.$  By Vieta's formulas, the sum of the roots in $x$ is then
\[\frac{a}{m}.\]These roots correspond to points $P$ and $Q,$ whose $y$-coordinates are then
\[\sqrt{4a \cdot \frac{a}{m}} = \frac{2a}{\sqrt{m}}.\]Thus, the $y$-coordinate of point $R$ is $\frac{2a}{\sqrt{m}}.$

Since line $QR$ passes through point $R,$ its equation is of the form
\[y = mx + \frac{2a}{\sqrt{m}}.\]Setting $y = 0,$ we get
\[x = \boxed{-\frac{2a}{m}}.\][asy]
unitsize(2 cm);

real a = 1;

pair P, Q, R, IN;
real mu;
path foo = y^2 - 4*a*x;

for (int i = 0; i <= 4; ++i) {
  mu = i;
  P = (a/(mu^2 - 2*mu - 8),2*a/sqrt(mu^2 - 2*mu - 8));
  Q = (a/(mu^2 - 2*mu - 8),-2*a/sqrt(mu^2 - 2*mu - 8));
  R = reflect((0,0),(1,0))*(P);
  IN = intersectionpoint(P--R, y = x*mu - a);
  draw(P--Q--R--cycle,gray(0.7));
  draw(P--IN,dashed);
  draw((0,0)--mu*1.5*abs(2*a/mu + mu/2),gray(0.7));
}
draw(foo,red);
draw((0,0)--2*abs(-2*a),red);
[/asy]

