The figure shown is called a trefoil and is constructed by drawing circular sectors about sides of the congruent equilateral triangles. What is the area of a trefoil whose horizontal base has length 2?

[asy]
unitsize(1cm);
path a =(-1.73,1)..(-1,1.73)--(-2,0)..cycle;
draw(a,linewidth(0.7));
path b= (1.73,1)..(2,0)--(1,1.73)..cycle;
draw(b,linewidth(0.7));
draw(shift((1,1.73))*a,linewidth(0.7));
draw(shift((-1,1.73))*b,linewidth(0.7));
draw((-1,1.73)--(1,1.73)--(0,0)--cycle,linewidth(0.7));
draw((-2,0)--(2,0),linewidth(0.7));
draw((-2,-0.2)--(2,-0.2),Arrows);
label("2",(0,-0.2),S);
[/asy]

solution:
The trefoil is constructed of four equilateral triangles and four circular segments, as shown. These can be  combined to form four $60^{\circ}$ circular sectors. Since the radius of the circle is 1,  the area of the trefoil is \[
\frac{4}{6}\left(\pi\cdot 1^2\right) = \boxed{\frac{2}{3}\pi}.
\][asy]
unitsize(1cm);
path a =(-1.73,1)..(-1,1.73)--(-2,0)..cycle;
draw(a,linewidth(0.7));
path b= (1.73,1)..(2,0)--(1,1.73)..cycle;
path c=(2,0)--(1,1.73)--(0,0)--cycle;
draw(b,linewidth(0.7));
draw(shift((0.5,2.5))*a,linewidth(0.7));
draw(shift((0,2.2))*b,linewidth(0.7));
draw(shift((0,2.2))*c,linewidth(0.7));
draw((-1,3.3)--(0,1.73),Arrow);
draw((-1,1.73)--(1,1.73)--(0,0)--cycle,linewidth(0.7));
draw((-2,0)--(2,0),linewidth(0.7));

[/asy]

