In right triangle $XYZ$, shown below, what is $\sin{X}$?

[asy]
draw((0,0)--(10,0)--(3.6,4.8)--cycle,black+linewidth(1));
draw(rightanglemark((0,0),(3.6,4.8),(10,0),20),black+linewidth(1));
label("X",(10,0),E);
label("Y",(3.6,4.8),N);
label("Z",(0,0),W);
label("10",(0,0)--(10,0),S);
label("8",(10,0)--(3.6,4.8),NE);
[/asy]

solution:
Quadrilateral $ABCD$ is a parallelogram, so we can find the area by multiplying the base and height.  Let's take $CD$ to be the base.

[asy]
pen sm=fontsize(9);
pair A=(3,7), B=(3,5), C=(-1,1), D=(-1,3), E=(3,1);
draw(A--B--C--D--cycle);
draw(B--E--C, dotted);
label("$A(3,7)$", A, NE, sm);
label("$B(3,5)$", B, E, sm);
label("$E(3,1)$", E, SE, sm);
label("$C(-1,1)$", C, SW, sm);
label("$D(-1,3)$", D, NW, sm);
label("$4$", (C+E)/2, S, sm);
label("$2$", (C+D)/2, W, sm);
draw(rightanglemark(B,E,C));
[/asy]

The length of $CD$ is $2$, and the length of $CE$ is $4$, so the area of parallelogram $ABCD$ is $2\cdot4 = \boxed{8}$.

We can factor $z^6 + z^4 + z^2 + 1 = 0$ as $(z^2+1)(z^4+1)=0$.  The roots of $z^2 = -1 = e^{\pi i}$ are $e^{\pi i/2}$ and $e^{3 \pi i/2}.$  The roots of $z^4 = -1 = e^{\pi i}$ are $e^{\pi i/4},$ $e^{3 \pi i/4},$ $e^{5 \pi i/4},$ and $e^{7 \pi i/4}.$

[asy]
unitsize(3 cm);

pair A, B, C, D, E, F, O;

A = dir(45);
B = dir(90);
C = dir(135);
D = dir(225);
E = dir(270);
F = dir(315);
O = (0,0);

draw((-1.2,0)--(1.2,0),gray(0.7));
draw((0,-1.2)--(0,1.2),gray(0.7));
draw(Circle((0,0),1),red);
draw(A--B--C--D--E--F--cycle);
draw(A--O--B,dashed);
draw(O--F,dashed);

dot("$e^{\pi i/4}$", dir(45), dir(45));
dot("$e^{3 \pi i/4}$", dir(135), dir(135));
dot("$e^{5 \pi i/4}$", dir(225), dir(225));
dot("$e^{7 \pi i/4}$", dir(315), dir(315));
dot("$e^{\pi i/2}$", dir(90), NE);
dot("$e^{3 \pi i/2}$", dir(270), SW);
dot(O);
[/asy]

By the Law of Cosines, the square of the distance between $e^{\pi i/4}$ and $e^{\pi i/2}$ is
\[1 + 1 - 2 \cos \frac{\pi}{4} = 2 - \sqrt{2}.\]The square of the distance between $e^{\pi i/4}$ and $e^{7 \pi i/4}$ is 2, so the sum of the squares of all sides is
\[4(2 - \sqrt{2}) + 2 \cdot 2 = \boxed{12 - 4 \sqrt{2}}.\]

