Now, let $A_1 = (-4,5,-17),$ $B_1 = (34,15,5),$ and let $C_1$ be the reflection of $B_1$ in $A_1.$  Then for any point $P \in C_1,$ triangle $A_1 B_1 P$ is equilateral.  Also, $A_1 C_1 = 2A_1 B_1 = 60,$ so
\[C_1 = (2 A_1 - B_1) = (-72,-5,-27).\]Furthermore,
\begin{align*}
\overrightarrow{A_1 C_1} &= \begin{pmatrix} -68 \\ -10 \\ -10 \\ \end{pmatrix}, \\
\overrightarrow{A_1 B_1} &= \begin{pmatrix} 38 \\ 10 \\ 22 \\ \end{pmatrix}.
\end{align*}Since
\[\overrightarrow{P} = \overrightarrow{A} + x \overrightarrow{A_1 C_1} + y \overrightarrow{A_1 B_1},\]where $x + y = 1,$ we can think of moving point $A_1$ in the direction of $\overrightarrow{A_1 C_1},$ and then moving in the direction of $\overrightarrow{A_1 B_1}.$  In other words,
\[\overrightarrow{P} = \overrightarrow{A} + x (\overrightarrow{A_1 C_1} + \overrightarrow{A_1 B_1}),\]or
\[\overrightarrow{P} - \overrightarrow{A} = x (\overrightarrow{A_1 C_1} + \overrightarrow{A_1 B_1}).\]Then $\overrightarrow{P} - \overrightarrow{A}$ traces out the addition of vectors in the direction of $\overrightarrow{A_1 C_1}$ and $\overrightarrow{A_1 B_1},$ like a rhombus.

[asy]
unitsize(0.6 cm);

