Let $A = -\frac{1}{2} + \frac{1}{2} i,$ $B = -\frac{1}{2} - \frac{1}{2} i,$ $C = -2i - \frac{1 + i}{\sqrt{2}}.$  Then
\begin{align*}
B - A &= -i, \\
