By the Law of Cosines on $\triangle PFQ,$
\[PQ^2 = PF^2 + FQ^2 - 2 \cdot PF \cdot FQ \cos \angle PFQ.\]Since $\angle PFQ = 90^\circ,$ this becomes
\[PQ^2 = PF^2 + FQ^2.\]By the Law of Cosines on $\triangle PRQ,$
\[PQ^2 = PR^2 + RQ^2 - 2 \cdot PR \cdot RQ \cos \angle PRQ.\]By the Law of Cosines on $\triangle FPR,$
\[PR^2 = PF^2 + FR^2 - 2 \cdot PF \cdot FR \cos \angle FPR.\]Since $\angle FPR = 90^\circ,$ this becomes
\[PR^2 = PF^2 + FR^2.\]Finally, by the Law of Cosines on $\triangle FRQ,$
\[RQ^2 = FR^2 + FQ^2 - 2 \cdot FR \cdot FQ \cos \angle FRQ.\]Since $\angle FRQ = 90^\circ,$ this becomes
\[RQ^2 = FR^2 + FQ^2.\]Note that $PR = PQ + QR.$  Substituting the appropriate expressions, we get
\[PF^2 + FR^2 = PQ^2 = PF^2 + FQ^2 - FP^2.\]Solving for $FP^2,$ we find that
\[FP^2 = \frac{1}{2} (FR^2 - FQ^2).\]We can eliminate $FP^2$ from the equation $PQ^2 = PF^2 + FQ^2.$  This gives us
\[PR^2 = \frac{1}{2} (3FQ^2 - FR^2),\]so
\[PR = \frac{1}{2} (5FR - 3FQ).\]Since $FR = FQ - QR,$
\[PR = \frac{1}{2} (7QR).\]Also, $FQ = RQ + QR,$ so
\[PF = FR + FQ - QR = 8QR;\]then $\frac{PF}{PR} = \frac{8}{7}.$  Hence,
\[\frac{4}{5} = \frac{PF}{PQ} = \frac{8}{7} \cdot \frac{QR}{PR} = \frac{8}{7} \cdot \frac{QR}{\frac{5}{2} QR} = \frac{8}{\frac{35}{2}},\]so $QR = \frac{35 \cdot 4}{32} = \frac{35}{8}.$

Let $A = (0,0).$  Then $AP = \frac{7}{4} PF,$ so the area of $\triangle AFP = \frac{1}{2} \cdot PF \cdot FR = \frac{1}{2} \cdot \frac{7}{4} PF \cdot \frac{7}{8} PQ = \frac{49}{32} PF \cdot PQ.$  Similarly, the area of $\triangle APQ = \frac{1}{2} \cdot PQ \cdot QR = \frac{1}{2} \cdot QR \cdot \frac{5}{2} QR = \frac{35}{8} \cdot \frac{5}{2} QR.$  Thus,
