6&$5\times2=10$&$2+4+6+8+10$\\ \hline
\end{tabular}

Continuing in this vein, the greatest possible total number of intersection points using ten circles is\[2+4+6+8+10+12+14+16+18=\boxed{90}.\] Or, we notice that every unique pair of circles carries at most two unique intersections. There are $\binom{10}{2} = \frac{10\cdot 9}{2!} = 45$ different pairs of circles, which give a total of $2\cdot 45 = \boxed{90}$ possible intersections.

