Since the area of the octagon is one square unit, the total area of the triangles is also one square unit. Thus, the area of one of the triangles is $1/8$ square units. Let $x = AB$. The area of one of the triangles can be expressed in terms of $s$ and $x$. We have:

$$\frac{1}{2} \cdot s \cdot x = \frac{1}{8}.$$

Now, we want to find the area of rectangle $ABEF$, which can be expressed as $s \cdot x$. It's clear that this rectangle has double the area of one of the triangles, since the rectangle is made up of 2 of these triangles. Therefore, the area of rectangle $ABEF$ is:

$$s\cdot x = 2\cdot \frac{1}{8} = \boxed{\frac{1}{4}}.$$

