solution:
Rotate $\triangle ABC$ $90^\circ$ counterclockwise about $C$, and let $B^\prime$ and $P^\prime$ be the images of $B$ and $P$, respectively.

[asy]
pair A,B,C,D,P,Q;
A=(10,0);
B=(0,10);
C=(0,0);
D=(-10,0);
P=(2.5,4);
Q=(-4,2.5);
draw(A--B--D--cycle,linewidth(0.7));
draw(B--C,linewidth(0.7));
draw(B--Q--C--P--cycle,linewidth(0.7));
draw(P--Q,linewidth(0.7));
