label("$B$",B,N);
label("$C$",C,S);
label("$B'$",D,S);
label("$P'$",Q,W);
label("$P$",P,E);
[/asy]

Then $CP^\prime = CP = 6$, and $\angle PCP^\prime =
90^\circ$, so $\triangle PCP^\prime$ is an isosceles right triangle. Thus $PP^\prime = 6\sqrt{2}$, and $BP^\prime = AP = 11$.  Because $\left(6\sqrt{2}\right)^2 + 7^2 = 11^2$, the converse of the Pythagorean Theorem implies that $\angle BPP^\prime = 90^\circ$. Hence $\angle BPC = 135^\circ$.  Applying the Law of Cosines in $\triangle BPC$ gives \[BC^2 = 6^2+7^2-2\cdot 6\cdot 7\cos 135^\circ
= 85+42\sqrt{2},\]and $a+b=\boxed{127}$.

