Let $O$ be the circumcenter.  If $s$ is the side length of the tetrahedron, then $BO = \frac{\sqrt{3}}{2} s$, and $MO = \frac{1}{2} \cdot \frac{2}{3} s = \frac{1}{3} s$.  Then by Pythagoras on right triangle $BMO$,
\[BM = \sqrt{(\sqrt{3}/2s)^2 - (s/3)^2} = \frac{\sqrt{2}}{3} s.\]We can also compute the area of triangle $ABM$.  The height of tetrahedron $ABCD$ is $\frac{\sqrt{2}}{\sqrt{3}} s$.  The area of triangle $ABM$ is then half this, or $\frac{\sqrt{2}}{2 \sqrt{3}} s$.  Thus, the height $h$ of triangle $ABM$ is
\[h = \frac{\frac{\sqrt{2}}{2 \sqrt{3}} s}{\frac{1}{2} s} = \frac{1}{\sqrt{6}}.\]Finally, in triangle $AMB$,
