By the Angle Bisector Theorem on triangles $ABC,$ $APD,$ $BQC,$ we have
\[\frac{z}{a} = \frac{x}{c}, \quad \frac{z}{b} = \frac{y}{a}.\]Then $xz = bij.$

By the Law of Cosines on triangle $ABC,$
\[c^2 = a^2 + b^2 - 2ab \cos C.\]By the Law of Cosines on triangle $APD,$
\[(x + z)^2 = b^2 + a^2 - 2(za)x.\]By the Law of Cosines on triangle $BQC,$
\[(y + z)^2 = c^2 + a^2 - 2(za)y.\]Subtracting these equations in pairs, we get $\boxed{a^2 = (x - y)c},$ $\boxed{b^2 = xc},$ and $\boxed{c^2 = -y(b - c)}.$  (The square of a side length need not be equal to the product of the other two side lengths.)

In triangle $EPQ,$ $\angle EQP = \frac{\angle BAC}{2},$ so
\[\angle DPE = 180^\circ - \angle ABC - \frac{\angle BAC}{2}.\]Hence,
\[\angle DPQ + \angle QPF = 180^\circ - \angle BPC - \frac{\angle BAC}{2}.\]Then
\[\angle DPF = \angle QPA.\]As above, angle bisectors of $\angle FQP$ and $\angle PQD$ intersect at a right angle.  Since $\angle YDF = 90^\circ,$
\[\angle YZF = 90^\circ,\]so $AYDF$ is cyclic.

Let $\angle APD = \alpha$ and $\angle BPC = \beta.$  To apply Ptolemy's Theorem or the Broken Chord Theorem, we need some side lengths.  Note that
\begin{align*}
\frac{AF}{FD} &= \frac{c - b\cos \angle B}{a - b\cos \angle B} = \frac{(y + z)a}{xa} = \frac{z + y}{x}, \\
\frac{AY}{YD} &= \frac{a - c\cos \angle C}{b - c\cos \angle C} = \frac{zac^2}{a^2 c} = \frac{z}{x}.
\end{align*}Applying Ptolemy's theorem to $AZYD$ and $DZYF,$ we get
\begin{align*}
AY \cdot DZ + ZY \cdot AD &= AY \cdot ZF + YZ \cdot AF, \\
AF \cdot DZ + ZF \cdot AD &= AF \cdot YF + FY \cdot FD.
\end{align*}Adding these equations, we get
\uref[yf]{EQ:YF}
\[AY \cdot DZ + ZY \cdot AD + AF \cdot DZ + ZF \cdot AD = AY \cdot ZF + YZ \cdot AF + AF \cdot YF + FY \cdot FD.\]Divide both sides by $AF \cdot ZF,$
\begin{align*}
\frac{AY \cdot DZ}{AF \cdot ZF} + \frac{ZY \cdot AD}{AF \cdot ZF} + \frac{AF \cdot DZ}{AF \cdot ZF} + \frac{ZF \cdot AD}{AF \cdot ZF} &= \frac{AY \cdot ZF}{AF \cdot ZF} + \frac{YZ \cdot AF}{AF \cdot ZF} + \frac{ZA}{ZA} + \frac{ZY \cdot FD}{AF \cdot ZF} \\
\frac{AY}{AF} + \frac{ZY}{ZF} + \frac{AD}{AF} + \frac{AD}{ZF} &= \frac{AY}{ZF} + \frac{YZ}{AF} + 1 + \frac{ZY}{ZA}.
\end{align*}We find
\begin{align*}
\frac{AY}{AF} &= \frac{x}{z} + 1 = \frac{x + z}{z}, \\
\frac{ZY}{ZF} &= \frac{x}{z}, \\
\frac{AD}{AF} &= \frac{a}{c}, \\
\frac{AD}{ZF} &= \frac{a}{b}, \\
\frac{AY}{ZF} &= \frac{x}{z}, \\
\frac{YZ}{AF} &= 1, \\
\frac{ZY}{ZA} &= a^2.
\end{align*}[hiddenatt]angle bisector theorem.Ptolemy's theorem.theorem of broken chords.Equality of ratios theorem.equation y(x + z) = xa\end{flushleft}\noindent Substituting and simplifying, we get
\[0 = \frac{x^2 - z^2}{z^2} + c.\]By the Factor Theorem, $(x - z)(x + z) = -z^2 c,$ so
\[c = \frac{x - z}{z}.\]Since $\frac{z}{a} + \frac{z}{b} = 1,$
\[1 = \frac{c^2}{c^2 - ac} + \frac{ac^2}{c^2 - ac} = \frac{c^3}{c^2 - ac}.\]Since $c \neq 0,$ we can cancel the factors of $c$ to get $c^2 - ac = 1.$  Squaring the equation $c = \frac{x - z}{z},$ we get
\[c^2 = \frac{x^2 - 2xz + z^2}{z^2},\]so
\[1 + ac = \frac{x^2 + 2xz + z^2}{z^2}.\]Then
\[0 = z^2 + (a - 1) zc^2 + c^2 - (a + 1) c = (z + c)(z + (a - 1)c).\]We cannot have $z + c = 0,$ so $z + (a - 1)c = 0.$  Then $a = 1 - \frac{z}{c} = \left( \frac{x + z}{c} \right) - 1,$ so
\[a = \frac{x}{c}.\]By difference of squares, $x^2 = z^2 (c + 1)^2,$ so $z^2 \le x^2 \le z^2 (c + 1)^2.$  Since $ac = (c - z)z,$
\begin{align*}
