&\ge ac(z^2 (c + 1)^2 - z^2 (c + 1)^2) \\
&\ge 0.
\end{align*}Since $a^2 - 1 = 1 - b^2 - c^2 \ge 0,$ $c^2 \le \frac{1}{2}$ (so $c \le \frac{\sqrt{2}}{2}$).

