problem:
A sphere is inscribed in a cone with height 4 and base radius 3.  What is the ratio of the volume of the sphere to the volume of the cone?

[asy]
fill(circle((1.5,0),1.5),gray(.7));
draw((0,3)--(4,0)--(0,-3));
draw(circle((1.5,0),1.5));
draw((0,0)..(1.5,-.3)..(3,0));
draw((0,0)..(1.5,.3)..(3,0),dashed);
draw(xscale(.15)*circle((0,0),3));
[/asy]

solution:
We start by finding the radius of the inscribed sphere. If we slice the diagram by a plane that contains the central axis of the cone, we get a circle inscribed in an isosceles triangle with base 6 and height 4, and the radius of the inscribed circle is the same as the radius of the sphere (since any plane that contains the central axis of the cone contains a diameter of the inscribed sphere). We label the points as shown in the diagram below.

[asy]
draw((0,3)--(4,0)--(0,-3)--cycle);
draw(circle((1.5,0),1.5));
draw((0,0)--(4,0),dashed);
label("$A$",(0,3),NW);
label("$B$",(4,0),E);
label("$C$",(0,-3),SW);
label("$D$",(0,0),W);
draw((0,.5)--(.5,.5)--(.5,0));
[/asy]

Since $AD$ has length 3 and $DB$ has length 4, segment $AB$ has length 5, from the Pythagorean theorem. Similarly, segment $CB$ has length 5.  Now, the area of triangle $ABC$ is equal to the semiperimeter times the radius of the inscribed circle. On the other hand, we know that the area of $ABC$ is also  \[\frac{1}{2} AC \cdot DB = \frac{1}{2} \cdot 6 \cdot 4 = 24/2. \]Let $\rho$ be the radius of the inscribed circle, and let $s$ be the semiperimeter of $ABC$.  We then have \[ \frac{24}{2} = \rho s = \rho \cdot \frac{AB + BC+ AC}{2}
=\rho \cdot \frac{16}{2} . \]Therefore \[ \rho = \frac{24}{16} = 3/2. \]Thus the volume of the inscribed sphere is $\frac{4}{3} \pi \rho^3
= \frac{4}{3} \pi (3/2)^3$.

On the other hand, the volume of a cone with radius $r$ and height $h$ is $\frac{\pi}{3} r^2 h$, so the volume of our cone is \[ \frac{\pi}{3} \cdot 3^2 \cdot 4 .\]Therefore the ratio of the volume of the sphere to the volume of the cone is \[ \frac{(4\pi /3) (3/2)^3}{(\pi/3) \cdot 3^2 \cdot 4}
= \frac{4 \cdot 27/8}{9 \cdot 4}
= \boxed{\frac{3}{8}} . \]

First, a solution with a Venn diagram: [asy]size(230);
import graph;
pair A = (0,-1); pair B = (sqrt(3)/2,1/2); pair C = (-sqrt(3)/2,1/2);
draw(Circle(A,1.2) ^^ Circle(B,1.2) ^^ Circle(C,1.2));
label(" 5",A); label("10",B); label("11",C); label("$12$",(0,0)); label("$19$",(B+C)/2); label("$8$",(A+B)/2); label("$17$",(A+C)/2);
label("Math",2.4C,C); label("English",2.4B,B); label("Science", 2.4A,A);[/asy] We build this diagram by working from the inside out.  First, we put the 12 in the middle for the 12 students who do all three subjects.  We then take care of the other 3 overlap regions by subtracting this 12 from each of the totals of students who did a pair of subjects.  Finally, we can find out the number of students who did only math by subtracting from 59 (the number of students who did math homework) the numbers in the math-and-other-subjects overlaps.  We can then do the same for the other subjects.  Adding all the numbers in the diagram, we see that there are 82 students who did some homework, so there are $100-82=\boxed{18}$ who did no homework at all.

Alternatively, we could solve this problem by first adding the number of students for each subject.  But students who do two subjects are counted twice, so we subtract the doubles (students doing homework for 2 subjects).  Now, we've added the students who did all three subjects three times (adding them in for each subject) and we've subtracted them three times (once for each "double" a student who did all three subjects is in).  So, we haven't counted them at all!  So, we have to add these "triples" back in!  This gives a total of  $$59+49+42-20-29-31+12=82$$ students.  There are 100 students total, so there are $100-82 = \boxed{18}$ students who did no homework.

