Since $AP = PD$, the area of rhombus $PQRS$ is half the area of square $ABCD$. We find that
$$[PQRS]=\frac{1}{2} [ABCD] = \frac{1}{2} (AB)(DA) = 2.$$

Now drop altitude $PK$ from $P$ to diagonal $DG$, with $K$ on $DG$. Since $PQRS$ is a rhombus, we know $PK \perp DG$. Hence, triangles $APD$ and $PKD$ share the common acute angle $D$, and they share a right angle at $P$ and $K$, respectively. Therefore, we find that $\angle KPD \cong \angle PDA$. Since $\angle PKD$ is vertical to $\angle PDA$, we have $\angle PKD \cong \angle PDA$ as well.

We conclude that triangles $APD$ and $PKD$ are similar. We know $AP = DP$, so $APD$ is an isosceles right triangle. Thus, $PKD$ must also be an isosceles right triangle since it is similar to $APD$. This means that $KD = KP$. We can simplify the equation $[PQRS] = 2$ to
$$\frac{1}{2}KV\cdot PK = 2,$$
and since $KD = KP$, we have
$$\frac{1}{2}PK^2 = 2.$$
Thus, $PK = KD =\sqrt{4} = 2$.

Now let's analyze triangle $DEQ$. We find $\angle DEQ$ is half of $\angle DEA$. Since $AEHD$ is a square, we know $\angle DEA = 90^\circ$. Thus, $\angle DEQ = 45^\circ$. Also, $\angle DQK = 45^\circ$ because $KD = KP$. Thus, $$\angle DQK = 180^\circ - 45^\circ = 135^\circ,$$
so $\angle EQK = 90^\circ - 45^\circ = 45^\circ$. Then, we find that triangles $DEQ$ and $DKQ$ share a right angle at $Q$. Meanwhile, $\angle DEQ = \angle EQK = 45^\circ$. Thus, triangles $DEQ$ and $DKQ$ are similar.

Since triangles $APD$ and $PKD$ are similar, we have $\frac{PD}{AP} = \frac{KD}{PD} \Longrightarrow PD^2 = AP \cdot KD = 2PD$. Therefore, $PD = 2$.

Finally, we know $DK = 2$ and $DQ = PD = 2$. Letting $PD = DK = x$ and $DE = y$, we can write the equation $[DEQ] = \frac{1}{2} DK \cdot QK$ as
$$\frac{1}{2}(2)(2) = \frac{1}{2} yx. \qquad (*)$$

Now observe that $\angle QDE = 180^\circ - \angle PDQ - \angle DEQ = 180^\circ - 90^\circ - 45^\circ = 45^\circ$, so triangle $DEQ$ is an isosceles right triangle. Thus, $x = y$, and we can divide both sides of equation $(*)(x = y)$ by $x$ to find that $x = y = \sqrt{2}$. Thus, the area of the shaded region is

$$[PQRS] - [DEQ] = [\square ABCD] - [\triangle DEQ] = 4 - \frac{x^2}{2} = 4 - \frac{(\sqrt{2})^2}{2} = \boxed{3}.$$

