Since $ABCDEF$ is a regular hexagon, $AB=BC=CD=DE=EF=FA=6$. The sum of these six edge lengths is $6+6+6+6+6+6 = 6 \cdot 6 = 36$.

Let $O$ be the center of the hexagon. Each angle of a regular hexagon measures $180^\circ\cdot\frac{6-2}{6} = 120^\circ$. Triangle $AOB$ is isosceles, so $\angle AOB=180^\circ-2\cdot(120^\circ)=2\cdot(180^\circ - 120^\circ)=60^\circ$.

The height of $POA$ is $OP\cdot\sin\angle AOP = 6\cdot\sin 60^\circ$. By the Pythagorean Theorem,
\begin{align*}
PA^2 &= PO^2+OA^2-2\cdot PO\cdot OA\cdot\cos\angle AOP \\
&=PO^2+3\cdot OA^2 \\
&=36+3\cdot\left(2\cdot OP\cdot\sin 60^\circ\right)^2 \\
&=36+3\cdot OP^2 \\
&=36+3^3=36+27=63 \\
\end{align*}
Thus, $PA=PD=PE=\sqrt{63}$.

The sum of the lengths of the edges of the pyramid is $PA+PB+PC+PD+PE+PF = PA+3\cdot(AB+PA)=\boxed{108}$.

